import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import logo   from '../picon.ico';
import styled from 'styled-components';

export default class Navi extends Component {
	render() {
		{/*
        https://www.iconfinder.com/icons/10496/poll_icon */}

		return (
			<navlook className="navbar sticky-top navbar-expand-sm navbar-dark bg-dark px-sm-5">
				<Link to="/">
					<img src={logo} alt="Poll" className="navbar-brand" />
				</Link>

				<ul className="navbar-nav align-items-center">
					<li className="nav-item ml-5">
						<Link to="/" className="nav-link">
							Poll Question
						</Link>
					</li>
					<li className="nav-item ml-5">
						<Link to="/Rate" className="nav-link">
								Ratings
						</Link>
					</li>
					<li className="nav-item ml-5">
						<Link to="/Comm" className="nav-link">
								Comments
						</Link>
					</li>
					<li className="nav-item ml-5">
						<Link to="/Choi" className="nav-link">
								Choices
						</Link>
					</li>
				</ul>	


				<Link to="/Logi" className="ml-auto">
					<button>
						Log-in
					</button>
				</Link>



			</navlook>
		);
	}
}

const navlook = styled.nav`
	background: var(--appleBlack) !important;
	.nav-link {
		font-size: 1.3rem;
		color: var(--cleanWhite) !important;
	}
`;
